class HomeScreenState {
  final bool isLoading;
  final bool hasError;
  final String? errorMessage;
  final HomeTab activeTab;

  HomeScreenState({
    this.isLoading = false,
    this.hasError = false,
    this.errorMessage,
    this.activeTab = HomeTab.personal,
  });

  // The copyWith function allows us to create a new instance of HomeScreenState
  // with modified values while keeping the other properties unchanged.
  HomeScreenState copyWith({
    bool? isLoading,
    bool? hasError,
    String? errorMessage,
    HomeTab? activeTab,
  }) {
    return HomeScreenState(
      isLoading: isLoading ?? this.isLoading,
      hasError: hasError ?? this.hasError,
      errorMessage: errorMessage ?? this.errorMessage,
      activeTab: activeTab ?? this.activeTab,
    );
  }
}

// Define the HomeTab enum for the tab states
enum HomeTab { personal, vehicles }
